import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { BrowserRouter } from 'react-router-dom';
import { publicPath } from './package.json';

ReactDOM.render(
    <React.StrictMode>
        <BrowserRouter basename={publicPath}>
            <App />
        </BrowserRouter>
    </React.StrictMode>,
    document.getElementById('root')
);
